import './login.css';

const Login = () =>{
    return (
        <>
        <div className="login">
        <h1>Log In</h1>
        <div> <input type="text" placeholder="E-mail"/></div>
        <div> <input type="text"placeholder="Password" /></div>
        <div><button>Log In</button></div>
        </div>
        </>
    );
}
export default Login;
